import httpClient from "../http-common1";


const create = (data) => {
    return httpClient.post("/security/user/b/i", data);
  };

  const getAll = () => {
    return httpClient.get("/security/admin/t");
  };
  const remove = (id) => {
    return httpClient.delete(`/security/user/delete/booking/${id}`);
  };
  const update = (id) => {
    return httpClient.put(`/security/user/update/booking/${id}` );
  };

